Gimme.Shelter.1970.1080p.Criterion.Bluray.DTS.x264-GCJM

=======

Called &quot;the greatest rock film ever made,&quot; this landmark documentary
follows the Rolling Stones on their notorious 1969 U.S. tour.
When 300,000 members of the Love Generation collided with a few
dozen Hell's Angels at San Francisco's Altamont Speedway, direct
cinema pioneers David and Albert Maysles and Charlotte Zwerin
immortalized on film the bloody slash that transformed a decade's
dreams into disillusionment.

